import { createUserWithEmailAndPassword } from './firebase';
import { auth, app } from './firebase';
import { addDoc, usersCollectionRef } from './firebase';


const registerFBUser = (e, email, password, firstname, lastname, dob) => {
    e.preventDefault();
    createUserWithEmailAndPassword(auth, setEmail, password)
      .then((userCredential) => {
        addDoc(usersCollectionRef, {
          userUID: 'UID',
          firstName: firstname,
          lastName: lastname,
          birthday: dob,
          email: email,
          prevPass: [],
          pwExpired: false,
          role: '',
          activated: false,
          suspended: false,
          suspensionStart: '',
          suspensionEnd: '',
          username: '',
          password: password,
        });
        console.log(userCredential);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  
  export default registerFBUser;
